    "2015-05-14T04:23:22.535949",nt"name": "maryland-environmental-trust-easements",nt"isopen":
    false,nt"url": null,nt"notes": "The Maryland Environmental Trust (MET)
    is a statewide local land trust governed by a citizen Board of Trustees. Since its
    creation by the General Assembly in 1967, MET's main goal is the preservation of
    open land, such as farmland, forest land, and significant natural resources. The
    primary tool for doing this is the conservation easement, a voluntary agreement
    between a landowner and the MET Board of Trustees. nnMET Conservation Easements
    promote growth management, the protection of significant natural resources and rural
    areas, and discourage sprawling development patterns. A Conservation Easement is
    a perpetual legal agreement between a landowner (grantor) and the Trust (grantee)
    ensuring that a property shall not be developed beyond a limit agreed upon by both
    parties. The land is thereby protected and preserved without detriment to the rights
    of ownership, occupancy, or privacy, while the agreement provides for significant
    income, estate, and property tax benefits.",nt"license_title": "License Not
